-- Expand our SalesOrder table
INSERT INTO [Sales].[SalesOrder] ([SalesPerson],[SalesAmount],[SalesDate],[SalesTerritory],[OrderDescription])
	SELECT  [SalesPerson]
			,[SalesAmount]
			,[SalesDate]
			,[SalesTerritory]
			,[OrderDescription]
	FROM [Sales].[SalesOrder];
 GO 3


-- Add some random date between this range
DECLARE @StartDate date = '1/1/2017';
DECLARE @EndDate date = '10/29/2023';

-- Update values to be random
UPDATE Sales.SalesOrder SET SalesDate = DATEADD(DAY, 
               RAND(CHECKSUM(NEWID()))*(1+DATEDIFF(DAY, @StartDate, @EndDate)), 
               @StartDate), 
			   SalesPerson = ABS(CHECKSUM(NEWID()) % 999),
			   SalesAmount = ROUND(RAND(CHECKSUM(NEWID())) * (10000), 1000);
GO

